import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import HomeUsersList from './HomeUsersList';

const useStyles = makeStyles(theme => ({
  cards: {
    marginTop: '150px',
    justify: 'space-around',
  },
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  usersWrapper: {
    marginTop: '150px',
    width: '100%',
    maxWidth: '1400px',
    margin: '0 auto',
    backgroundImage:
      'https://images.unsplash.com/photo-1497366811353-6870744d04b2?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
  },
}));

function Home() {
  const classes = useStyles();
  const [users, setUsers] = useState([1, 2, 3]);
  return (
    <Grid
      className={classes.usersWrapper}
      container
      spacing={3}
      justify="center"
    >
      <HomeUsersList users={users} />
    </Grid>
  );
}

export default Home;
